package com.hayashi2026.leetcode.palindrome

class `Shortest Palindrome` {

    fun shortestPalindrome(s: String): String {
        if (isPalindrome(s)) {
            return s
        }
        for (i in s.length - 1 downTo 1) {
            var res = s
            for (j in i until s.length) {
                res = "${s[j]}$res"
            }
            if (isPalindrome(res)) {
                return res
            }
        }
        return s
    }

    fun isPalindrome(s: String): Boolean {
        var start = 0
        var end = s.length - 1
        while (start < end) {
            if (s[start] != s[end]) {
                return false
            }
            start++
            end--
        }
        return true
    }
}

fun main(args: Array<String>) {
    val test = `Shortest Palindrome`()
    println(test.shortestPalindrome(""))
}